import hashlib

flag = ""

md5s = {}
for i in range(65, 128):
  md5s[hashlib.md5(chr(i).encode()).hexdigest()] = chr(i)

n = 32
chunks = [flag[i:i+n] for i in range(0, len(flag), n)]

str1 = ""
for i in chunks:
  if i in md5s: 
    n = ord(md5s.get(i))
    n -= 2
    n = chr(n)
    str1 += str(n) 

print(str1)